【アルガンラボ プレミアムセレクト アルガンオイルの詳細】<br>●モロッコの宝石といわれる貴重なアルガンの実から丁寧に低温抽出された、上質なアルガンオイルです。肌や髪など全身のケアにお使いいただけます。<br>●防腐剤・香料・保存料無添加。<br>●コールドプレス製法で濃厚成分そのまま。<br>●洗顔後の1滴でもちもちの艶肌へ。<br><br>【使用方法】<br>●お肌に：洗顔後、1-2滴を手に取り、顔全体によく伸ばします。その後、化粧水などの通常のお手入れを行ってください。乾燥が気になる部分に優しくマッサージをするように塗り重ねても効果的です。<br>●身体に：乾燥が気になる部分にやさしくなじませてください。<br>●指先に：乾燥が気になる部分への塗布や、キューティクルケアに。<br>●髪に：乾燥や傷みが気になる部分へのアウトバストリートメントとして。<br><br>【ご注意】<br>○お肌に異常が生じていないかよく注意して、使用してください。<br>○お肌に合わないときは使用をお止めください。<br>○次のような場合には使用を中止し、皮膚科専門医等にご相談されることをおすすめします。<br>1.使用中、赤み、はれ、かゆみ、刺激、色抜け（白斑）や黒ずみ等の異常が生じた場合。<br>2.使用したお肌に、直射日光があたって上記のような症状が生じた場合。<br>○本品は天然物のため、保管状況や温度環境により澱のような沈殿物や浮遊物、白濁、または凝固することがありますが、品質上の問題はありません。低温環境により凝固した場合はしばらく温かい場所に静置し、軽く振る等してからご使用ください。<br>○本品は天然物にため、色調や香りにばらつきがみられる場合があります。<br>○本品は食用ではございません。<br>○直射日光や高温多湿を避けて保管してください。<br><br>【成分】<br>アルガニアスピノサ核油<br><br>【内容量】<br>30ml<br><br><br>【原産国】<br>日本<br><br>【販売元・製造元・輸入者名】<br>ARGAN LABO<br>
東京都狛江市岩戸南2-18-5<br>
お電話：03-5761-2460<br><br>【商品区分】<br>化粧品<br><br>［アルガンラボ アルガンオイル］<br><br><br><hr>広告文責：株式会社モリキ<br>電話：0269-38-0611<br><style type="text/css">
